Here's a basic code for addition in Java:
```
public class Addition {
    public static void main(String[] args) {
        int num1 = 5;
        int num2 = 10;
        int sum = num1 + num2;
        System.out.println("The sum of " + num1 + " and " + num2 + " is " + sum);
    }
}
```
In this code, we declare two integer variables `num1` and `num2` and assign them values of 5 and 10, respectively. We then use the `+` operator to add the values of `num1` and `num2` and store the result in a new variable called `sum`. Finally, we use the `System.out.println` statement to print out the sum of the two numbers.

Here is an example of code for a basic addition program in Java:
```
public class Main {
   public static void main(String[] args) {
      int num1 = 5;
      int num2 = 7;
      int sum = num1 + num2;
      System.out.println(sum);
   }
}
```
In this code, we declare two integer variables `num1` and `num2` and initialize them with values 5 and 7 respectively. We then perform the addition of `num1` and `num2` and store the result in a new integer variable `sum`. Finally, we use the `System.out.println()` statement to print the value of `sum` to the console. This code can be easily modified to add other numbers by changing the values of `num1` and `num2`.

